(function() {
  'use strict';

  angular
    //.module('fc.paging', [])
    .module('maps')
    .directive('wanMaterialPaging', WanMaterialPagingDirective);

  /**
   * @ngInject
   */
  function WanMaterialPagingDirective() {
    return {
      restrict: 'EA',
      scope: {
        wmpTotal: '=',
        position: '@',
        gotoPage: '&',
        step: '=',
        currentPage: '='
      },
      controller: Controller,
      controllerAs: 'vm',
      template: [
        '<div layout="row" class="wan-material-paging" layout-align="{{ position }}">',
        '<md-button class="md-raised md-primary wmp-button" ng-click="vm.gotoFirst()">{{ vm.first }}</md-button>',
        '<md-button class="md-raised wmp-button" ng-click="vm.getoPre()" ng-show="vm.index - 1 >= 0">...</md-button>',
        '<md-button class="md-raised wmp-button" ng-repeat="i in vm.stepInfo"',
        ' ng-click="vm.goto(vm.index + i)" ng-show="vm.page[vm.index + i]" ',
        ' ng-class="{true: \'md-primary\', false: \'\'}[vm.page[vm.index + i] === currentPage]">',
        ' {{ vm.page[vm.index + i] }}',
        '</md-button>',
        '<md-button class="md-raised wmp-button" ng-click="vm.getoNext()" ng-show="vm.index + vm.step < wmpTotal">...</md-button>',
        '<md-button class="md-raised md-primary wmp-button" ng-click="vm.gotoLast()">{{ vm.last }}</md-button>',
        '</div>'
      ].join('')
    };
  }

  /**
   * @ngInject
   */
  function Controller($scope) {
    var vm = this;

    vm.first = '<<';
    vm.last = '>>';
    vm.index = 0;
    vm.step = $scope.step;

    vm.goto = function(index) {
      $scope.currentPage = vm.page[index];
    };

    vm.getoPre = function(){
      $scope.currentPage = vm.index;
      vm.index -= vm.step;
    };

    vm.getoNext = function(){
      vm.index += vm.step;
      $scope.currentPage = vm.index + 1;
    };

    vm.gotoFirst = function(){
      vm.index = 0;
      $scope.currentPage = 1;
    };

    vm.gotoLast = function(){
      vm.index = parseInt($scope.wmpTotal / vm.step) * vm.step;
      vm.index === $scope.wmpTotal ? vm.index = vm.index - vm.step : '';
      $scope.currentPage = $scope.wmpTotal;
    };

    $scope.$watch('currentPage', function() {
      $scope.gotoPage();
    });

    $scope.$watch('wmpTotal', function() {
      vm.init();
    });

    vm.init = function() {
      vm.stepInfo = (function() {
        var i, result = [];
        for (i = 0; i < vm.step; i++) {
          result.push(i)
        }
        return result;
      })();

      vm.page = (function() {
        var i, result = [];
        for (i = 1; i <= $scope.wmpTotal; i++) {
          result.push(i);
        }
        return result;
      })();

    };
  }

})();
(function() {
  angular.module("maps").directive("propertiesEditor", [
    "$timeout", function($timeout) {
      return {
        scope: {
          properties: '=propertiesEditor',
          propertyKeyName: '@',
          propertyValueName: '@'
        },
        templateUrl: "directives/properties-editor.html",
        controller: [
          '$scope', '$element', function($scope, $element) {
            if ($scope.propertyKeyName == null) {
              $scope.propertyKeyName = 'key';
            }
            if ($scope.propertyValueName == null) {
              $scope.propertyValueName = 'value';
            }
            $scope.remove = function(index) {
              return $scope.properties.splice(index, 1);
            };
            return $scope.add = function() {
              var empty_property, i, input, len, new_property, ref;
              empty_property = false;
              ref = $element.find("input.property-name");
              for (i = 0, len = ref.length; i < len; i++) {
                input = ref[i];
                if (!input.value.trim()) {
                  empty_property = true;
                  input.focus();
                  break;
                }
              }
              if (!empty_property) {
                new_property = {};
                new_property[$scope.propertyKeyName] = '';
                new_property[$scope.propertyValueName] = '';
                $scope.properties.push(new_property);
                return $timeout((function() {
                  $element.find('.property:last input:first').focus();
                }), 0, false);
              }
            };
          }
        ],
        link: function(scope) {
          var typeIsArray;
          typeIsArray = Array.isArray || function(value) {
            return {}.toString.call(value) === '[object Array]';
          };
          if (!typeIsArray(scope.properties)) {
            return scope.properties = [];
          }
        }
      };
    }
  ]);

}).call(this);
